def get2Dproject(points, P,W):
    Z=np.min( np.sum(P,axis=1))
    A= np.sum(P,axis=1) !=Z
    svd=np.linalg.svd(P)
    print("svd1:",svd[1])
    proj=svd[2]
    #print("projection",P)
    print("projection svd", proj)

    #proj=proj[:,0:2]
    proj=proj[0:2,:]
    proj = proj.transpose()
    #proj=proj[:,W]

#    print("projection--->", proj)
    return np.matmul(points, proj)

def get_view_point(P):
    svd=np.linalg.svd(P)
    proj=svd[2]
    view_point=proj[2,:]
    return view_point



def get2dpoints(points, P):
    points2d= np.zeros((len(points),3))
    for i in range(0, len(points)):
        x=P*points[i]
        x=np.sum(x, axis=0)
        points2d[i]=x
    return points2d

